pragma solidity ^0.8.0;

import "./features/Liquidator.sol";

contract UTB is Liquidator {
	mapping(address => bool) private centers;

	event CenterAdded(address newCenter);
	event CenterRemoved(address oldCenter);

	constructor(address _uniswapV2Router) Liquidator("Utilitybia Token", "UTB", _uniswapV2Router) {
		super._mint(msg.sender, 100 ether / pointRate); // UTB for 100 ETH
	}

	function decimals() public view virtual override returns (uint8) {
		return 2;
	}

	modifier onlyCenter(address _center) {
		require(centers[_center], "Permission denied");
		_;
	}

	function addCenter(address _center) external onlyOwner {
		require(_center != address(0), "Center invalid");
		require(!centers[_center], "Center exists");
		centers[_center] = true;
		emit CenterAdded(_center);
	}

	function removeCenter(address _center) external onlyOwner {
		require(_center != address(0), "Center invalid");
		require(centers[_center], "Center does not exists");
		delete centers[_center];
		emit CenterRemoved(_center);
	}

	function isCenter(address _center) public view returns (bool) {
		return centers[_center];
	}

	function mint(address account, uint256 amount) external onlyCenter(msg.sender) {
		require(account != address(0), "Account invalid");
		require(amount > 0, "Amount invalid");
		super._mint(account, amount);
	}

	function burn(uint256 amount) external {
		require(amount > 0, "Amount invalid");
		super._burn(msg.sender, amount);
	}
}
