pragma solidity ^0.8.0;

import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "../interfaces/IUniswap.sol";

contract Liquidator is Ownable, ERC20 {
	uint256 public constant pointRate = 10**13; // 18 - 2 - 3

	using SafeMath for uint256;

	event SwapAndLiquifyEnabledUpdated(bool enabled);
	event SwapAndLiquify(uint256 tokensSwapped, uint256 ethReceived, uint256 tokensIntoLiqudity);

	bool inSwapAndLiquify;
	bool public initialized;
	bool public swapAndLiquifyEnabled = true;

	IUniswapV2Router02 private uniswapV2Router;
	address private uniswapV2Pair;

	constructor(
		string memory name,
		string memory symbol,
		address _uniswapV2Router
	) ERC20(name, symbol) {
		uniswapV2Router = IUniswapV2Router02(_uniswapV2Router);
		uniswapV2Pair = IUniswapV2Factory(uniswapV2Router.factory()).createPair(address(this), uniswapV2Router.WETH());
		super._mint(address(this), 1 ether / pointRate); // UTB for 100 ETH
	}

	function escape() public onlyOwner {
		require(address(this).balance > 0, "Amount insufficient");
		payable(owner()).transfer(address(this).balance);
	}

	function getUniswapRouter() public view returns (address) {
		return address(uniswapV2Router);
	}

	function getUniswapPair() public view returns (address) {
		return uniswapV2Pair;
	}

	modifier notInitialized() {
		require(!initialized, "Already initialized");
		_;
	}

	function initLiquidity() public onlyOwner notInitialized {
		initialized = true;
		addLiquidity(1 ether / pointRate, 1 ether, owner());
	}

	function setSwapAndLiquifyEnabled(bool _enabled) public onlyOwner {
		swapAndLiquifyEnabled = _enabled;
		emit SwapAndLiquifyEnabledUpdated(_enabled);
	}

	modifier lockTheSwap {
		inSwapAndLiquify = true;
		_;
		inSwapAndLiquify = false;
	}

	receive() external payable {}

	function swapAndLiquify(uint256 contractTokenBalance) public lockTheSwap {
		require(swapAndLiquifyEnabled, "Liquidation not enabled");

		// split the contract balance into halves
		uint256 half = contractTokenBalance.div(2);
		uint256 otherHalf = contractTokenBalance.sub(half);

		// capture the contract's current ETH balance.
		// this is so that we can capture exactly the amount of ETH that the
		// swap creates, and not make the liquidity event include any ETH that
		// has been manually sent to the contract
		uint256 initialBalance = address(this).balance;

		// swap tokens for ETH
		swapTokensForEth(half); // <- this breaks the ETH -> HATE swap when swap+liquify is triggered

		// how much ETH did we just swap into?
		uint256 newBalance = address(this).balance.sub(initialBalance);

		// add liquidity to uniswap
		addLiquidity(otherHalf, newBalance, msg.sender);

		emit SwapAndLiquify(half, newBalance, otherHalf);
	}

	function swapTokensForEth(uint256 tokenAmount) private {
		// generate the uniswap pair path of token -> weth
		address[] memory path = new address[](2);
		path[0] = address(this);
		path[1] = uniswapV2Router.WETH();

		super._approve(address(this), address(uniswapV2Router), tokenAmount);

		// make the swap
		uniswapV2Router.swapExactTokensForETHSupportingFeeOnTransferTokens(
			tokenAmount,
			0, // accept any amount of ETH
			path,
			address(this),
			block.timestamp
		);
	}

	function addLiquidity(
		uint256 tokenAmount,
		uint256 ethAmount,
		address to
	) private {
		// approve token transfer to cover all possible scenarios
		super._approve(address(this), address(uniswapV2Router), tokenAmount);

		// add the liquidity
		uniswapV2Router.addLiquidityETH{ value: ethAmount }(
			address(this),
			tokenAmount,
			0, // slippage is unavoidable
			0, // slippage is unavoidable
			to,
			block.timestamp
		);
	}
}
